<!doctype html>
<html>
<head>
  <meta charset="utf-8"/>
  <title>RTOS Trace Visualizer</title>

  <style>
    body {
      font-family: system-ui, -apple-system, Segoe UI, Roboto, Arial, sans-serif;
      background: #f6f7fb;
      margin: 16px;
      color: #111;
    }
    .grid {
      display: grid;
      grid-template-columns: 1fr 280px;
      gap: 14px;
      align-items: start;
    }
    .card {
      background: white;
      border: 1px solid rgba(0,0,0,0.08);
      border-radius: 14px;
      box-shadow: 0 10px 25px rgba(0,0,0,0.04);
      padding: 12px;
      margin-bottom: 14px;
    }
    .card h2 {
      margin: 0 0 8px 0;
      font-size: 16px;
      font-weight: 650;
    }
    .subtle {
      color: #555;
      font-size: 13px;
      margin-top: 6px;
    }
    .slider-row {
      display:flex;
      align-items:center;
      gap:12px;
      flex-wrap: wrap;
    }
    #xmaxValue {
      font-weight: 650;
      background: #eef2ff;
      border: 1px solid rgba(0,0,0,0.06);
      padding: 6px 10px;
      border-radius: 10px;
      min-width: 96px;
      text-align: center;
    }
    input[type="range"] {
      width: 520px;
      accent-color: #6366f1;
    }

    .legend {
      max-height: 980px;
      overflow: auto;
      padding-right: 6px;
    }
    .legend-item {
      display:flex;
      align-items:center;
      gap:10px;
      padding: 6px 6px;
      border-radius: 10px;
    }
    .legend-item:hover {
      background: rgba(99,102,241,0.08);
    }
    .swatch {
      width: 16px;
      height: 10px;
      border-radius: 3px;
      border: 1px solid rgba(0,0,0,0.15);
      flex: 0 0 auto;
    }
    .lname {
      font-size: 13px;
      word-break: break-word;
    }
    .legend-more {
      color:#666; font-size: 12px; padding: 8px 6px;
    }

    table.dataTable tbody td { font-size: 12px; }
    table.dataTable thead th { font-size: 12px; }
  </style>
